Specialfall: 
1. Om den långsiktiga menstruationscykeln är ungefär 28 dagar för kvinnor, kan du hänvisa till denna APP; 
2. Kvinnor vars menstruationscykel är för kort eller för lång gäller inte denna APP; 
3. Olika skäl kommer att få säkerhetsperioden att ändras, så den här appen är endast för referens, inte som ett effektivt preventivmedel.

